body.div:
			Τίνος χάριν οὐκ εἶπεν, ὅτι ἠκούσατε ὅτι εἶπον τοῖς ἀρχαίοις;
ἐπειδὴ δυσπαράδεκτος ὁ λόγος ἐγένετο, καὶ πᾶσιν ἃν πρόσεστι
τοῖς ἀκούουσι· τὸ δὲ “οὑ φονεύσεις” καλῶς τέθεικε πρῶτον, διὰ

			Τί ἐστι τὸ “ἀποδεκατοῦται τὸ ἡδύοσμον, καὶ τὰ ἑξῆς;
ἐνταῦθα μὲν οὖν εἰκότως φησὶν, ἔνθα δεκάτη ἐστιν, τι παραβλάπτει
τὸ ἐλεημοσύνην διδόναι; ἀλλ’ οὐχ ὡς νόμον τηροῦντας,
